import React from 'react';
import {Switch, Route, Link, HashRouter} from 'react-router-dom';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Home from './Home';
import CreateAccount from './CreateAccount';
import UIElements from './UIElements';
import NotFound from './NotFound';
import CreateJob from './CreateJob';
import ULogo from './utilities/ULogo';
import UButton from './utilities/UButton';
import './../style/UNavStyle.css';

export default class UHeader extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            selections: this.props.selections,
        };
    }

    updateNavBar = () => {
        this.setState({
            selections: [
                <Nav.Link key={'changed-1'} as={Link} to={'/'}>
                    <UButton variant={'primary'}>Changed</UButton>
                </Nav.Link>,
                <Nav.Link key={'it-2'} as={Link} to={'/create_account'}>
                    <UButton variant={'primary'}>It</UButton>
                </Nav.Link>,
            ],
        });
    };

    render() {
        return (
            <HashRouter>
                <Navbar className={'u-nav sticky-top'}>
                    <Navbar.Brand>
                        <ULogo height={'70px'} long />
                    </Navbar.Brand>
                    <Nav className={'ml-auto mr-4'}>{this.props.selections}</Nav>
                </Navbar>
                <div className={'content'}>
                    <Switch>
                        <Route
                            exact
                            path={'/'}
                            render={(props) => <Home {...props} updateNavBar={this.updateNavBar} />}
                        />
                        <Route exact path={'/create_account'} component={CreateAccount} />
                        <Route exact path={'/ui'} component={UIElements} />
                        <Route exact path={'/create-job'} component={CreateJob} />
                        <Route
                            render={function () {
                                return <NotFound />;
                            }}
                        />
                    </Switch>
                </div>
            </HashRouter>
        );
    }
}
